import React, { Component } from "react";
import styled from "@emotion/styled";
import { Container, Menu } from "semantic-ui-react";
import "./Topline.css";

export default class Topline extends Component {
  render() {
    const ToplineWrapper = styled.div`
      width: 100%;
      background-color: #263238;
      color: #fff;
    `;
    return (
      <ToplineWrapper>
        <Menu secondary>
          <Menu.Item className="ToplineItem">Оплата и доставка</Menu.Item>
          <Menu.Item className="ToplineItem">Обмен и возврат</Menu.Item>
          <Menu.Item className="ToplineItem">Контактная информация</Menu.Item>
          <Menu.Item className="ToplineItem">Статьи</Menu.Item>
          <Menu.Item className="ToplineItem">Отзывы</Menu.Item>
        </Menu>
        <Menu.Menu position="right">
          <Menu.Item position="right">fd</Menu.Item>
        </Menu.Menu>
      </ToplineWrapper>
    );
  }
}
